const Test = () => (
    document.addEventListener("DOMContentLoaded", function () { 
         document.getElementById('a').style.color = '#fff'; 
         return(
             <div>
      <h1><button onClick={()=>Test()}>Show Albums</button></h1>
      <p id="a" style={{color:'#000'}}></p>
       </div>
         )
   })
  )

  export default Test;
